import React from 'react';
import styles from './LeadsContainer.module.css';

const LeadsContainer = ({leadkeys, leads}) => {

    let columns = <React.Fragment> 
                        <div style={{minWidth:"3rem"}} className={styles.column}>
                            <input type="checkbox"/>
                        </div> 
                        { leadkeys.map((key, index) => <div  key={index} className={styles.column}>{key.label}</div>) } 
                    </React.Fragment>;
    let leadsRecords = <React.Fragment>
                           { leads.map(lead => <div key={lead.id} style={{borderBottom: "1px solid #E5E7EB"}} className={styles["lead-column"]}>
                           <div style={{minWidth:"3rem"}} className={styles.record}>
                           <input type="checkbox"/>
                            </div>
                            <div className={ styles.record }>
                                {lead.company|| "-"}
                            </div> 
                            <div className={ styles.record }>
                                { lead.first_name|| "-" }
                            </div> 
                            <div className={styles.record}>
                                { lead.last_name|| "-" }
                            </div>
                            <div className={styles.record} style={{minWidth:"18rem"}}>
                                { lead.email|| "-" }
                            </div>
                            <div className={styles.record}>
                                { lead.website|| "-" }
                            </div>
                            <div className={styles.record}>
                                { lead.s_email|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.language|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.phone|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.mobile|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.fax|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.lead_source|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.lead_industry|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.skype_id|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.state|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.street|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.po|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.zip_code|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.city|| "-" }
                            </div>
                            <div className={styles.record}>
                            { lead.country|| "-" }
                            </div>
                            </div> ) 
                        }
                        </React.Fragment>

    return  <section className={styles.leadsContainer}>
                <section className={styles.leadsfilter}>
                    <p>Filter Leads by:</p>
                </section>
                <section className={styles.leadsrecords}>
                    <div className={styles["lead-columns"]}>
                        { columns }
                    </div>
                        {leadsRecords}
                </section>
            </section>
}

export default LeadsContainer
